    "jaar": 2008,
    "price": "60,-"
},{
    "Id": 4,
    "title": "Ugly love",
    "auteur": "Janis Joplin",
    "jaar": 2016,
    "price": "60,-"
},{
    "Id": 5,
    "title": "Rich dad, poor dad",
    "auteur": "Harry Mulish",
    "jaar": 2022,
    "price": "60,-"
}]  

class bookList extends React.Component {


   render(){

    console.log(books)
       return (
        <div >

           <h1>BoekenLijst</h1>



           { books?.map( book => <Book key={book.Id} auteur={book.auteur} title={book.title} jaar={book.jaar} price={book.price} / >)   }
           (books?.map((book, i) => <div key={i}>{book.title}</div>))

        </div>
    );
    }
};

export default bookList;
